import { __assign } from "tslib";
import event from './event';
import { repTypes } from '../../config';
var force = false;
/** 点击控件 */
export function clickButton(metaId, currModule, extra) {
    force = false;
    base(metaId, currModule, extra);
}
export function clickButtonForce(metaId, currModule, extra) {
    force = true;
    base(metaId, currModule, extra);
}
function base(metaId, currModule, extra) {
    var data = {};
    if (typeof currModule === 'string') {
        data.currModule = currModule;
        /** clickButton取消同步module */
        // pageData.prevModule = currModule;
        // notifyNative(pageData.prevPage || '', currModule);
    }
    else {
        data = currModule;
    }
    return event.bind(this)(metaId, repTypes.UBT.subTypes.CLICK_BUTTON, __assign(__assign({}, data), extra), force);
}
